genai.configure(api_key=api_key)
model = genai.GenerativeModel('gemini-2.5-flash-lite')

def rellenar_info_batch_con_gemini(lote_volcanes):
    """
    Usa la API de Gemini para obtener datos de un LOTE de volcanes en una sola llamada.
    """
    print(f"Procesando lote de {len(lote_volcanes)} volcanes con Gemini...")
    
    # Crea una lista formateada de nombres para el prompt
    nombres_para_prompt = "\n".join([f"- {v['vName']}" for v in lote_volcanes])

    # El prompt ahora pide procesar una lista y devolver una lista de JSONs
    prompt = f"""
    Analiza la siguiente lista de nombres de volcanes. Para CADA uno de ellos, busca en tu conocimiento general y devuelve un objeto JSON con los siguientes campos: "name", "type", "status", "information", y "imageUrl".

    LISTA DE VOLCANES A PROCESAR:
    ---
    {nombres_para_prompt}
    ---

    RESPONDE ÚNICAMENTE con un array JSON que contenga un objeto por cada volcán de la lista, en el mismo orden.
    Asegúrate de que el JSON esté bien formado y todos los campos en inglés, mostrando una breve descripción en "information" de al menos 20 palabras y una URL de imagen válida en "imageUrl".

    Ejemplo de la respuesta esperada para una lista de dos volcanes:
    el status será uno de los siguientes: "Active", "Inactive", "Dormant", "Extinct".
    [
      {{
        "name": "Abu",
        "type": "Shield volcano",
        "status": "Inactive",
        "information": "Grupo de volcanes en escudo en Honshu, Japón.",
        "imageUrl": "https://una.url.de/imagen/abu.jpg"
      }},
      {{
        "name": "Acatenango",
        "type": "Stratovolcano",
        "status": "Active",
        "information": "Estratovolcán activo en Guatemala, conocido por sus vistas del cercano Volcán de Fuego.",
        "imageUrl": "https://una.url.de/imagen/acatenango.jpg"
      }}
    ]
    """

    try:
        response = model.generate_content(prompt)
        cleaned_response = response.text.strip().replace('```json', '').replace('```', '')
        # Parseamos la respuesta, que ahora es una lista de diccionarios
        datos_gemini_lista = json.loads(cleaned_response)
        
        # Verificamos que Gemini devolvió la cantidad correcta de resultados
        if len(datos_gemini_lista) == len(lote_volcanes):
            print(f"  -> Lote procesado correctamente.")
            return datos_gemini_lista
        else:
            print(f"  -> ERROR: Gemini devolvió {len(datos_gemini_lista)} resultados para un lote de {len(lote_volcanes)}.", file=sys.stderr)
            return None

    except Exception as e:
        print(f"  -> Fallo crítico en el proceso de Gemini para el lote: {e}", file=sys.stderr)
        return None
    finally:
        # Pausa más larga entre lotes para respetar los límites de peticiones por minuto
        time.sleep(5) 



