with open('volcanoData.ts', 'w', encoding='utf-8') as f:
    f.write("export enum VolcanoStatus {\n")
    f.write("    Active = 'Active',\n    Inactive = 'Inactive',\n    Dormant = 'Dormant',\n}\n\n")
    f.write("export interface Volcano {\n")
    f.write("    id: string;\n    name: string;\n    lat: number;\n    lng: number;\n    elevation: number;\n")
    f.write("    type: string;\n    status: VolcanoStatus;\n    information: string;\n    imageUrl: string;\n}\n\n")
    f.write("export const volcanoData: Volcano[] = [\n")

    # --- NUEVO BUCLE PARA PROCESAR POR LOTES ---
    for i in range(0, len(volcanes), BATCH_SIZE):
        # Crea un lote (batch) de volcanes
        lote_actual = volcanes[i:i + BATCH_SIZE]
        
        # Llama a la función de Gemini con el lote completo
        resultados_del_lote = rellenar_info_batch_con_gemini(lote_actual)
        
        # Si la llamada a la API falló para el lote, lo saltamos
        if not resultados_del_lote:
            print(f"Saltando lote {i//BATCH_SIZE + 1} debido a un error.", file=sys.stderr)
            continue
            
        # Itera sobre los volcanes y los resultados obtenidos para escribirlos
        for volcan, datos_enriquecidos in zip(lote_actual, resultados_del_lote):
            if not volcan.get('vnum') or not volcan.get('vName'):
                continue

            nombre_limpio = re.sub(r'[\s/\[\]]+', '', volcan['vName'])
            id_volcan = f"v_{volcan['vnum']}_{nombre_limpio}"
            
            info_escapada = datos_enriquecidos.get('information', '').replace("'", "\\'").replace('\n', ' ')
            tipo_escapado = datos_enriquecidos.get('type', 'Volcano').replace("'", "\\'")
            status_valor = datos_enriquecidos.get('status', 'Dormant')
            image_url = datos_enriquecidos.get('imageUrl', '')
            nombre_escapado = volcan['vName'].replace("'", "\\'")

            f.write("    {\n")
            f.write(f"        id: '{id_volcan}',\n")
            f.write(f"        name: '{nombre_escapado}',\n") # Usamos la variable temporal
            f.write(f"        lat: {volcan.get('latitude', 0)},\n")
            f.write(f"        lng: {volcan.get('longitude', 0)},\n")
            f.write(f"        elevation: {volcan.get('elevation_m', 0)},\n")
            f.write(f"        type: '{tipo_escapado}',\n")
            f.write(f"        status: VolcanoStatus.{status_valor},\n")
            f.write(f"        information: '{info_escapada}',\n")
            f.write(f"        imageUrl: '{image_url}'\n")
            f.write("    },\n")

    f.write("];\n")
print("\n¡Proceso por lotes completado con Gemini! El fichero 'volcanoData.ts' ha sido creado.")